    false,nt"url": null,nt"notes": "We are collecting stream channel geometry
    and bed sediment grain size distribution data at Sedgeunkedunk stream to evaluate
    physical habitat changes associated with the Brewer Dam removal. These data complement
    studies led by others that are investigating biological responses to the project.
    Together, the physical and biological data collected in the lower Sedgeunkedunk
    stream help us understand the effectiveness of dam removal for restoring diadromous
    fish access and ecosystem recovery.",nt"license_title": null,nt"extras":
